import React from 'react'
import './navbar.css'


const Menu =() =>{
  <>
   <p><a href='#home'>Home</a></p>
   <p><a href='#about'>About</a></p>
   <p><a href='#project'>Project</a></p>
  </>
}

const Navbar = () => {
  return (
    <div className='portfolio__navbar'>
        <div className='navbar-logo'>

        </div>
    </div>
  )
}

export default Navbar
